package day4

import (
	"testing"
)

func TestXmasCounter_Simple(t *testing.T) {
	var result = xmasCounter(`AAXMASAA
	AASAMXAA`)
	if result != 2 {
		t.Errorf("Got %d instead of 2", result)
	}
}

func TestXmasCounter_Example(t *testing.T) {
	var result = xmasCounter(`MMMSXXMASM
MSAMXMSMSA
AMXSXMAAMM
MSAMASMSMX
XMASAMXAMM
XXAMMXXAMA
SMSMSASXSS
SAXAMASAAA
MAMMMXMMMM
MXMXAXMASX`)
	if result != 18 {
		t.Errorf("Got %d instead of 18", result)
	}
}

